import React from 'react';
import Home_Content_Goals from "./Home_Content_Goals";
import Home_Content_Media from "./Home_Content_Media";
import Home_Content_Login from "./Home_Content_Login";


function Home() {
    const userLoggedIn: Boolean = true;

    return (
        <div>
            {userLoggedIn && <Home_Content_Goals/>}
            {!userLoggedIn && <Home_Content_Media/>}
            {!userLoggedIn && <Home_Content_Login/>}
        </div>
    );
}

export default Home;
